  <>
    <section className="contact">
      <div>
        <h1 className="title">Any questions or comments?</h1>
        <p className="body">Send your inquiries below</p>
      </div>
      <button className="btn">Let's talk!</button>
    </section>
    <style jsx>
      {`
        .contact {
          display: flex;
          margin-top: 100px;
          margin-bottom: 200px;
          padding-left: 15%;
        }
        .title {
          font-size: 30px;
          margin-bottom: 5px;
          box-shadow: 13px 13px rgba(255, 153, 204, 0.3);
        }
        .body {
        }
        .btn {
          font-size: 15px;
          padding: 10px;
          margin-top: 50px;
        }
      `}
    </style>
  </>
);

export default Contact;
